import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:3001/api';

// Create axios instance with default config
const api = axios.create({
  baseURL: API_BASE_URL,
  withCredentials: true,
  headers: {
    'Content-Type': 'application/json',
  },
});

// Debug interceptor
api.interceptors.request.use(
  (config) => {
    console.log('ðŸ”— API Request:', {
      method: config.method,
      url: config.url,
      data: config.data,
      headers: config.headers
    });
    return config;
  },
  (error) => {
    console.error('âŒ API Request Error:', error);
    return Promise.reject(error);
  }
);

api.interceptors.response.use(
  (response) => {
    console.log('ðŸ“¨ API Response:', {
      status: response.status,
      data: response.data
    });
    return response;
  },
  (error) => {
    console.error('âŒ API Response Error:', {
      status: error.response?.status,
      data: error.response?.data,
      message: error.message
    });
    if (error.response?.status === 401) {
      localStorage.removeItem('token');
      localStorage.removeItem('user');
      window.location.href = '/login';
    }
    return Promise.reject(error);
  }
);

// Auth API functions
export const login = (credentials) => api.post('/auth/login', credentials);
export const loginUser = (credentials) => api.post('/auth/login', credentials); // Alias
export const register = (userData) => api.post('/auth/register', userData);
export const registerUser = (userData) => api.post('/auth/register', userData); // Alias
export const logout = () => {
  localStorage.removeItem('token');
  localStorage.removeItem('user');
  return Promise.resolve();
};

// Profile API functions
export const getProfile = () => api.get('/user/profile');
export const updateProfile = (profileData) => api.put('/user/profile', profileData);

// Payment API functions
export const uploadPayment = (paymentData) => {
  const formData = new FormData();
  Object.keys(paymentData).forEach(key => {
    if (paymentData[key] !== null && paymentData[key] !== undefined) {
      formData.append(key, paymentData[key]);
    }
  });
  
  return api.post('/payments/upload', formData, {
    headers: {
      'Content-Type': 'multipart/form-data',
    },
  });
};

export const getPaymentHistory = (filters = {}) => {
  const params = new URLSearchParams();
  Object.keys(filters).forEach(key => {
    if (filters[key]) {
      params.append(key, filters[key]);
    }
  });
  return api.get(`/payments/history?${params.toString()}`);
};

export const approvePayment = (paymentId) => api.put(`/payments/${paymentId}/approve`);
export const rejectPayment = (paymentId, data = {}) => api.put(`/payments/${paymentId}/reject`, data);

// Dashboard API functions
export const getDashboardData = () => api.get('/member/dashboard');
export const getMemberDashboard = () => api.get('/member/dashboard'); // Alias

export const getAdminDashboard = (params = {}) => {
  const queryParams = new URLSearchParams();
  Object.keys(params).forEach(key => {
    if (params[key]) {
      queryParams.append(key, params[key]);
    }
  });
  return api.get(`/admin/dashboard?${queryParams.toString()}`);
};
export const getAdminDashboardData = (params = {}) => getAdminDashboard(params); // Alias

// Admin - Pending Approvals
export const getPendingApprovals = () => api.get('/admin/approvals');

// Admin - Members Management
export const getAllMembers = () => api.get('/admin/members');
export const updateMemberStatus = (memberId, statusData) => api.put(`/admin/members/${memberId}/status`, statusData);
export const deleteUser = (userId) => api.delete(`/admin/members/${userId}`);
export const getMemberDetails = (memberId) => api.get(`/admin/members/${memberId}`);

// Transactions API functions
export const getTransactions = (filters = {}) => {
  const params = new URLSearchParams();
  Object.keys(filters).forEach(key => {
    if (filters[key]) {
      params.append(key, filters[key]);
    }
  });
  return api.get(`/transactions?${params.toString()}`);
};

export const getAllTransactions = (filters = {}) => getTransactions(filters); // Alias

export const addExpense = (expenseData) => api.post('/transactions/expense', expenseData);
export const addIncome = (incomeData) => api.post('/transactions/income', incomeData);
export const updateTransaction = (transactionId, transactionData) => api.put(`/transactions/${transactionId}`, transactionData);
export const deleteTransaction = (transactionId) => api.delete(`/transactions/${transactionId}`);

// File upload helper
export const uploadFile = (file, type = 'receipt') => {
  const formData = new FormData();
  formData.append('file', file);
  formData.append('type', type);
  
  return api.post('/upload', formData, {
    headers: {
      'Content-Type': 'multipart/form-data',
    },
  });
};

// Additional utility functions
export const getCurrentUser = () => {
  const userData = localStorage.getItem('user');
  return userData ? JSON.parse(userData) : null;
};

export const isAuthenticated = () => {
  return !!localStorage.getItem('token');
};

export const getAuthToken = () => {
  return localStorage.getItem('token');
};

// Export the axios instance for custom requests
export default api;
